;app.controller('calculatorCtrl', function ($scope) {
    $scope.debtType = 'salliemae';

    $scope.resetState = function() {
        $scope.total = 0;
        $scope.secondaryMarketDebt = 0;
        $scope.totalInterest = 0;
        $scope.BEGINNING_PRINCIPAL = 0;
        $scope.ESTIMATED_INTEREST = .068;
        $scope.ESTIMATED_YEARS = 20;
    }
    $scope.resetState()

    var getDebtMarketPrice = function() {
        var price = 1
        switch($scope.debtType) {
            case 'federal':
                price = 1.05
                break
            case 'salliemae':
                price = .15
                break
        }
        return $scope.BEGINNING_PRINCIPAL * price
    }

    var calculateDebt = function(debt, interest, yearsLeft) {
        if (yearsLeft <= 0) {
            $scope.total = $scope.BEGINNING_PRINCIPAL + interest
            $scope.totalInterest = interest
            $scope.secondaryMarketDebt = getDebtMarketPrice()
            return
        }
        var interestPaid = debt * $scope.ESTIMATED_INTEREST
        return calculateDebt(debt - interestPaid, interest + interestPaid, yearsLeft - 1)
    }

    $scope.submit = function() {
        debt = parseFloat($scope.debt.replace(',', ''))
        if (!isNaN(debt) && debt != '') {
            $scope.BEGINNING_PRINCIPAL = debt
            calculateDebt(debt, 0, $scope.ESTIMATED_YEARS);
            $scope.showValues = true
        }
        else {
            $scope.showValues = false
            $scope.resetState()
        }
    };
});
;app.controller('carouselCtrl', function ($scope, $http, $interval) {
  var items = $('.carousel-item')
  var navItems = $('.carousel-nav-item')

  var autoAdvance = true
  var i = 0

  function scrollItems () {
    if (!autoAdvance) return
    nextItem(i)
  }
  $interval(scrollItems, 5000)

  function nextItem () {
    if (i >= (items.length - 1)) i = 0
    else i += 1
    activateItem(i)
  }

  function previousItem () {
    if (i === 0) i = items.length - 1
    else i -= 1
    activateItem(i)
  }

  function activateItem (i) {
    items.each(function (index, item) {
      $(item).removeClass('active')
    })

    var item = items[i]
    $(item).addClass('active')

    navItems.each(function (index, item) {
      $(item).removeClass('active')
    })

    var navItem = navItems[i]
    $(navItem).addClass('active')
  }

  $scope.nextItemButton = function () {
    nextItem()
    autoAdvance = false
  }

  $scope.prevItemButton = function () {
    previousItem()
    autoAdvance = false
  }

  $scope.chooseItemButton = function (i) {
    activateItem(i)
    autoAdvance = false
  }

})
;Array.prototype.chunk = function(chunkSize) {
    var array=this;
    return [].concat.apply([],
        array.map(function(elem,i) {
            return i%chunkSize ? [] : [array.slice(i,i+chunkSize)];
        })
    );
}

if (!String.prototype.endsWith) {
  String.prototype.endsWith = function(searchString, position) {
      var subjectString = this.toString();
      if (position === undefined || position > subjectString.length) {
        position = subjectString.length;
      }
      position -= searchString.length;
      var lastIndex = subjectString.indexOf(searchString, position);
      return lastIndex !== -1 && lastIndex === position;
  };
}

app.controller('corinthianCtrl',
  function ($scope, $window, $http, $document) {
    $scope.debtors = 13415;
    $scope.debt = 354135;
    $scope.money = 24194;

    $scope.corinthianLetterVisible = true;
    $scope.showCorinthians = false;
    $scope.currentStriker = null;
    $scope.loading = true;
    $scope.corinthian = false;
    $scope.corinthian15 = []
    $scope.corinthian100 = []
    $scope.strikeTeam = []

    $http.get('/static/data/strikers.json').then(function (resp) {
      $scope.loading = false;
      for (i in resp.data) {
        var striker = resp.data[i]
        striker.first_name = striker.name.split(' ')[0].toLowerCase()
        if (striker.first_name) {
          striker.image = "/static/img/strikers/striker-portraits_" + striker.first_name + ".png"
          striker.bigImage = striker.image
          striker.index = i
          $scope.corinthian15.push(striker)
          $scope.strikeTeam.push(striker)
        }
      }
      $scope.corinthian15Chunks = $scope.corinthian15.chunk(5)
    });

    $http.get('/static/data/name_only_strikers.csv').then(function (resp) {
      $scope.strikeTeamNames = resp.data.split('\n')
    })

    $http.get('/static/data/new_strikers.json').then(function (resp) {
      $scope.loading = false;
      for (i in resp.data) {
        var striker = resp.data[i]
        striker.name = striker["Name"]
        striker.bio = striker["Striker Bio"]
        var photo = striker["Photo URL"]
        if (!photo || photo.indexOf('imgur.com') < 0) {
          striker.image = "/static/img/strikers/anon-striker.png"
          striker.bigImage = "/static/img/strikers/anon-striker.png"
        }
        else {
          if (!photo.endsWith('.jpg')) {
            photo = photo + '.jpg'
          }
          striker.image = photo.replace('.jpg', 'b.jpg')
          striker.bigImage = photo.replace('.jpg', 'm.jpg')
        }
        $scope.corinthian100.push(striker)
        $scope.strikeTeam.push(striker)
      }
    });

    $scope.agreeButton = function () {
      $scope.normalsignup = true
    }

    $scope.showStriker = function (striker, $event) {
      history.pushState(null, striker.name, "#" + striker.first_name)
      $scope.currentStriker = striker
      if ($event) $event.stopPropagation()
    }

    $scope.closeStriker = function ($event) {
      $scope.currentStriker = null
      if ($event) $event.stopPropagation()
    }

    $scope.showCorinthianLetter = function () {
      $scope.corinthianLetterVisible = true
      setTimeout(function () {
        var elem = angular.element(document.getElementById('corinthianLetter'))
        $document.scrollToElementAnimated(elem)
      }, 100)
    }

    $scope.showSolidarityLetter = function () {
      $scope.corinthianLetterVisible = false
      setTimeout(function () {
        var elem = angular.element(document.getElementById('solidarityLetter'))
        $document.scrollToElementAnimated(elem)
      }, 100)
    }

    $window.addEventListener('popstate', function () {
      if ($scope.currentStriker) {
        $scope.closeStriker()
        $scope.$digest()
      }
    })

    $scope.formVisible = function () { return true; }
});
